import React,{
  Component
} 
from 'react';

import Pomodoro from "./components/pomodoro";
import Timer from "./functions/timer";

class App extends Component {
  render(){
    const timer = new Timer(5);

    timer.onStart(() => {
      console.log("start");
    })
    .onEnd(() => {
      console.log("end");
    })
    .onInterval(() => {
      console.log("interval");
    });

    console.log(timer.onEndFn);

    console.log(timer);


    return (
      <Pomodoro
      onChangeBreakLength={() => console.log(1)}
      onChangeSessionLength={() => console.log(1)}

      onClickStart={() => console.log(1)}
      onClickStop={() => console.log(1)}
      onClickReset={() => console.log(1)}

      display={"00:00:00"}/>
    );
  }
}

export default App;
